                    {movies.map((item) =>
                        <Movie
                            key={item.id}
                            cover={item.medium_cover_image}
                            id={item.id}
                            title={item.title}
                            rating={item.rating}
                            genres={item.genres}
                            summary={item.summary} />)}
                </div>
            }
        </div >
    );
}
